import React from "react";

const PatientNavbar = () => {
  return (
    <nav className="bg-blue-600 text-white p-4 shadow-md">
      <h1 className="text-xl font-bold">Patient Dashboard</h1>
    </nav>
  );
};

export default PatientNavbar;
